import React from "react";

const Gadgets = () => {
  const gadgets = [
    { id: 1, name: "Laptop", price: "$20/day", features: "8GB RAM, 512GB SSD" },
    { id: 2, name: "Camera", price: "$15/day", features: "DSLR, 4K Video" },
    { id: 3, name: "Gaming Console", price: "$25/day", features: "PlayStation 5, Xbox Series X" },
  ];

  return (
    <section id="gadgets" className="py-20 bg-gray-100">
      <h2 className="text-center text-4xl font-bold mb-10">Available Gadgets</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-8 px-4 md:px-20">
        {gadgets.map((gadget) => (
          <div key={gadget.id} className="bg-white p-6 rounded shadow text-center">
            <h3 className="text-xl font-bold">{gadget.name}</h3>
            <p className="text-gray-600 mt-2">{gadget.features}</p>
            <p className="text-blue-500 font-bold mt-2">{gadget.price}</p>
            <button className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
              Rent Now
            </button>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Gadgets;
